// constraints aren't met.
type CloudEventExecutionStartMultiError []error

// Error returns a concatenation of all the error messages it wraps.
func (m CloudEventExecutionStartMultiError) Error() string {
	msgs := make([]string, 0, len(m))
	for _, err := range m {
		msgs = append(msgs, err.Error())
	}
	return strings.Join(msgs, "; ")
}

// AllErrors returns a list of validation violation errors.
func (m CloudEventExecutionStartMultiError) AllErrors() []error { return m }

// CloudEventExecutionStartValidationError is the validation error returned by
// CloudEventExecutionStart.Validate if the designated constraints aren't met.
type CloudEventExecutionStartValidationError struct {
	field  string
	reason string
	cause  error
	key    bool
}

// Field function returns field value.
func (e CloudEventExecutionStartValidationError) Field() string { return e.field }

// Reason function returns reason value.
func (e CloudEventExecutionStartValidationError) Reason() string { return e.reason }

// Cause function returns cause value.
func (e CloudEventExecutionStartValidationError) Cause() error { return e.cause }

// Key function returns key value.
func (e CloudEventExecutionStartValidationError) Key() bool { return e.key }

// ErrorName returns error name.
func (e CloudEventExecutionStartValidationError) ErrorName() string {
	return "CloudEventExecutionStartValidationError"
}

// Error satisfies the builtin error interface
func (e CloudEventExecutionStartValidationError) Error() string {
	cause := ""
	if e.cause != nil {
		cause = fmt.Sprintf(" | caused by: %v", e.cause)
	}

	key := ""
	if e.key {
		key = "key for "
	}

	return fmt.Sprintf(
		"invalid %sCloudEventExecutionStart.%s: %s%s",
		key,
		e.field,
		e.reason,
		cause)
}

var _ error = CloudEventExecutionStartValidationError{}

var _ interface {
	Field() string
	Reason() string
	Key() bool
	Cause() error
	ErrorName() string
} = CloudEventExecutionStartValidationError{}
